import React, { Suspense } from 'react';
import { NavLink, Link, withRouter } from 'react-router-dom';
import { makeStyles } from '@material-ui/core/styles';
import { Button } from '@material-ui/core';
import { useNavigate } from 'react-router-dom';

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
    },
  },
}));

const Grupos = React.lazy(() => import('../champions/grupos.js'));
const Rounds = React.lazy(() => import('../champions/round/one.js'));

const Buttons = () => {
  const classes = useStyles();
  let navigate = useNavigate();

  const goToGrupos = () => {
    let path = `/champions/grupos`;
    navigate(path);
  };
  const goToRounds = () => {
    let path = `/champions/round`;
    navigate(path);
  };
  return (
    <Suspense fallback={<div>Loading...</div>}>
      <div className={classes.root}>
        <Button variant="outlined" onClick={goToGrupos}>
          Grupos
        </Button>
        <Button variant="outlined" onClick={goToRounds}>
          Cuadro final
        </Button>
      </div>
      <Switch>
        <Route path="/champions/grupos" component={Grupos} />
        <Route path="/champions/round" component={Rounds} />
      </Switch>
    </Suspense>
  );
};

export default Buttons;
